DROP TABLE IF EXISTS persons CASCADE;

CREATE TABLE persons (
user_id VARCHAR(50) PRIMARY KEY REFERENCES users(user_id),
salutation VARCHAR(10),
first_name VARCHAR(25) NOT NULL,
last_name VARCHAR(50) NOT NULL,
street_address1 VARCHAR(75),
street_address2 VARCHAR(75),
city VARCHAR(75),
province VARCHAR(50),
postal_code VARCHAR(50),
primary_phone_number VARCHAR(15) NOT NULL,
secondary_phone_number VARCHAR(15),
fax_number VARCHAR(10),
preferred_contact_method VARCHAR(50) NOT NULL
);

ALTER TABLE persons OWNER TO group25_admin;

